window.bookSummaryJSON = "<p><b>Belinda Baker and I were not made for each other.</b></p> <p>We are not soul mates, or lovers, or even frenemies. She is the one who needed to get away.</p> <p>What we had together wasn’t blind love, it was sick rage. We were a match made in hell, it was hate at first sight, and when she walked away from me and never looked back - it was a relief.</p> <p>It was bliss.</p> <p>So why did I travel 2,000 miles so I could be near her? Why can’t I stop thinking about this girl I never want to see again?</p> <p>Why. Am I. Here?</p> <p>And what do I have to do to make her disappear for good?</p> <p>Includes a special bonus note from the author.</p> <p><i>Tony</i> features two girls falling for the wrong men, two men falling for the right girl, and a family of tatted-up brothers in a town filled with secrets and danger. It’s a story of earned chances and first dates...and of coming to terms with the past to find a way to move forward. It is book six in the Bossy Brothers series.</p>"; 
